]



export default function Portfolio() {


  const Imagewraper = ({ src, name, time }) => {

    return (
      <div className="wraper">
        <img className="image" src={src} alt={name}></img>

        <div className="title">
          <h3>{name}</h3>
          <h4>{time}</h4>
